export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},cSetREUxE0:{data:{id:1548,attributes:{imdbId:"tt1464540",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMjI0NDI1MTMyM15BMl5BanBnXkFtZTcwMDMzMTcyNA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"},{Source:"Rotten Tomatoes",Value:"33%"},{Source:"Metacritic",Value:"36\u002F100"}],item_lang:{data:{id:2211,attributes:{title:"I Am Number Four",plot:"Extraordinary teen John Smith (Pettyfer) is a fugitive on the run from ruthless enemies sent to destroy him. Changing his identity, moving from town to town with his guardian Henri (Olyphant), John is always the new kid with no ties to his past. In the small Ohio town he now calls home, John encounters unexpected, life-changing events - his first love (Agron), powerful new abilities and a connection to the others who share his incredible destiny.",slug:"i-am-number-four"}}},books:{data:[{id:8119,attributes:{title:"I Am Number Four: The Lost Files: The Last Days of Lorien",description:"The fifth instalment of the Lost Files, The Last Days of Lorien, is the stunning prequel novella to the Lorien Legacies series by Pittacus Lore. Before Number Four and the other members of the Garde arrived on Earth, they lived on the planet Lorien. A planet filled with others who also possessed extraordinary abilities. A peaceful planet - until the day the Mogadorians attacked, and nearly annihilated, the Loric people. Told through the eyes of Sandor, Number Nine's Cêpan and one of only a handful of Loric survivors, this is what happened in those final days on Lorien. This is Sandor's story. Praise for Pittacus Lore: 'Tense, exciting, full of energy' Observer 'Relentlessly readable' The Times 'Tense, keeps you wondering' Sunday Times 'Set to eclipse Harry Potter and moody vampires. Pittacus Lore is about to become one of the hottest names on the planet' Big Issue The first book in Pittacus Lore's Lorien Legacies series, I Am Number Four, is now a major Disney motion picture.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dsSKyjLqrMsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2013-04-09",publisher:"Penguin UK",subtitle:e}},{id:8120,attributes:{title:"I Am Number Four Collection: Books 1-6",description:"The first six novels in the New York Times bestselling Lorien Legacies series are included in this collection: I Am Number Four: The book that started it all . . . Nine of us came here. We look like you. We talk like you. We live among you. But we are not you. We can do things you dream of doing. We have powers you dream of having. We are stronger and faster than anything you have ever seen. Our plan was to grow, and train, and become strong, and become one, and fight them. But they found us and started hunting us first. I am next. The Power of Six: I've seen him on the news. Followed the stories about what happened in Ohio. There are six of us left. We're hiding, blending in, avoiding contact with one another . . . but our Legacies are developing, and soon we'll be equipped to fight. Is John Number Four, and is his appearance the sign I've been waiting for? And what about Number Five and Six? I am Number Seven. One of six still alive.And I'm ready to fight. The Rise of Nine: In order to save our world and their own, John and Nine must join forces with Six and Seven who have been battling the Mogadorians in Spain, and who are now trying to locate Number Eight in India. The Fall of Five: When the Garde receive a sign from Number Five—a crop circle in the shape of a Lorien symbol—they know they are close to being reunited. But could it be a trap? Time is running out, and the only thing they know for certain is that they have to get to Five before it's too late. The Revenge of Seven: The Garde have suffered an unbearable loss. Number Five has betrayed them. Eight is gone forever. Ella has been kidnapped. The others are now scattered. The Garde are broken and divided once again, but they will not be defeated. As long as one still stands, the battle for Earth's survival is not lost. The Fate of Ten: The sixth and penultimate book in the series! For years the Garde have fought the Mogadorians in secret. Now all of that has changed. The invasion has begun. The Garde are stretched thin, fighting this war on many fronts. The only chance they have is to take out the Mogadorian leader once and for all—but his fate is now irrevocably tied with Ella's. They can't destroy one without the other. But if the Garde can't find another way to stop the Mogs, humanity will suffer the same fate as the Loric: annihilation.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aN1UCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:d,subtitle:"I Am Number Four, The Power of Six, The Rise of Nine, The Fall of Five, The Revenge of Seven, The Fate of Ten"}},{id:8121,attributes:{title:"I Am Number Four: The Beginning: Books 1-3 Collection",description:"The first three novels in the bestselling Lorien Legacies series that began with I Am Number Four are included in this collection: I Am Number Four: The book that started it all . . . Nine of us came here. We look like you. We talk like you. We live among you. But we are not you. We can do things you dream of doing. We have powers you dream of having. We are stronger and faster than anything you have ever seen. Our plan was to grow, and train, and become strong, and become one, and fight them. But they found us and started hunting us first. Now all of us are running. They caught Number One in Malaysia. Number Two in England. And Number Three in Kenya. They killed them all. I am Number Four. I am next. The Power of Six: I've seen him on the news. Followed the stories about what happened in Ohio. John Smith, out there, on the run. To the world, he's a mystery. But to me . . . he's one of us. There are six of us left. We're hiding, blending in, avoiding contact with one another . . . but our Legacies are developing, and soon we'll be equipped to fight. Is John Number Four, and is his appearance the sign I've been waiting for? And what about Number Five and Six? I am Number Seven. One of six still alive.And I'm ready to fight. The Rise of Nine: The stakes are higher than ever as John, Six, and Seven try desperately to find the rest of the Garde before it's too late. During the dangerous mission at the Mogadorian base in West Virginia, John found and rescued Nine. But even with their combined powers, special abilities known as Legacies, the pair barely escaped with their lives—and they lost Sam in the process. In order to save our world and their own, John and Nine must join forces with Six and Seven who have been battling the Mogadorians in Spain, and who are now trying to locate Number Eight in India.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9pRVCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:d,subtitle:"I Am Number Four, The Power of Six, The Rise of Nine"}},{id:8122,attributes:{title:"I Am Number Four: The Lost Files: Last Defense",description:"In this electrifying one-hundred-page companion novella to the New York Times bestselling I Am Number Four series, discover what happened to Malcolm Goode after the Mogadorian invasion began. When the Garde split up, heading off to New York City and Mexico, Malcolm decided to stay behind in Ashwood Estates, the Mog’s formerly hidden base located near Washington DC. He wanted to search the facility for anything that might help John Smith and the others stop the alien invasion. But once the spaceships descended, that plan went up in smoke. Before he gets a chance to come up with a plan B, armed soldiers storm the base. As one of the few humans who knows anything about Loric and their war with the Mogadorians, Malcolm is an invaluable asset—and they’ve been tasked with safely escorting him to the president’s secret bunker. With Mogs hot on their trail, though, it’ll be easier said than done. Luckily, Malcolm has some backup in the form of a Chimæra. But even if he makes it to his destination, will Malcolm be able to help what’s left of the government find a way to defeat the Mogs? Or will he be too late?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UI7BCQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2016-02-23",publisher:d,subtitle:e}},{id:8123,attributes:{title:"I Am Number Four: The Lost Files: The Guard",description:"In this spectacular one-hundred-page companion novella to the New York Times bestselling I Am Number Four series, learn how Loric hacker Lexa became the shadowy figure known as GUARD. A sequel to I Am Number Four: The Lost Files: The Navigator, this novella picks up with Lexa shortly after the Mogadorians raided her hideout and murdered her friend. Determined to get her revenge but knowing she can't take the Mogs head on, Lexa goes in search of a weapon that just might help her do some real damage: the spaceship the Garde flew to Earth. The only problem is it's under lock and key at a highly guarded base in Dulce, New Mexico. Lexa's quest to retrieve the ship and track down the Garde has her cross paths with an ally of Pittacus Lore, come under fire from both the FBI and the Mogs, and team up with a headstrong teenager from Paradise, Ohio, by the name of Mark James. To get her secret weapon, Lexa will do whatever it takes. But as the Mogadorians begin their invasion, will it be enough to help save the Garde—and the world?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7p0pBQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2015-07-28",publisher:d,subtitle:e}}]}}},meta:{}}},prerenderedAt:1681377322487}}("Pittacus Lore","movie",null,"HarperCollins","","series",1,"2015-09-01"))